    form_token varchar(200) NOT NULL,
    training_set integer NOT NULL,
    CONSTRAINT surveys_answer_question_id_c0166f3c_fk_surveys_question_id FOREIGN KEY (question_id) REFERENCES surveys_question (id) DEFERRABLE INITIALLY DEFERRED
);
CREATE INDEX surveys_answer_question_id_c0166f3c ON public.surveys_answer (question_id);
